import axios from 'axios';
import React from 'react';
import { useState } from 'react';
import MyButton from '../Buttons/MyButton';
import { Stack } from "@mui/material";
import { useNavigate } from 'react-router-dom';
import Header from '../components/Header/Header';

const ManageQuizes = () => {

    const navigateTo = useNavigate();
    const [data, setData] = useState([]);
    const [numberOfSearch, setNumberOfSearch] = useState(3);
    const [searchUsernameNonAdmin, setSearchUsernameNonAdmin] = useState('');
    const [searchData, setSearchData] = useState('');


    const handleSearch = () => {
        setNumberOfSearch(numberOfSearch + 5);
    };

    const handleUsernameNonAdmin = async (e) => {
        setSearchUsernameNonAdmin(e.target.value);
        await axios.get('http://localhost:5000/admin/searchQuizes?quiz=' + e.target.value ).then(json => setSearchData(json.data));
        renderSearchTable();
    };



    React.useEffect(() => {
        axios.get('http://localhost:5000/admin/getCategories').then(json => setData(json.data));
    }, []);


    const renderSearchTable = () => {
        var i = 0;
        const num = numberOfSearch;
        if (searchData) {
            return searchData.map(quiz => {
                while (i < num) {
                    i = i + 1;
                    return (
                        <tr key={quiz.sifKviz} style={{ height: '40px', }}>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}>{kviz.name}</td>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}><img src={image.data_url} alt="" width="100" /></td>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}>{kviz.nazivKategorije}</td>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}>{kviz.availableFrom}</td>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}>{kviz.availableTo}</td>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}>{kviz.durationSec}</td>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}>{kviz.reviewDurationSec}</td>
                            <td style={{ borderLeft: '1px solid #eeeee4', borderRight: '1px solid #eeeee4', borderBlockEnd: '1px solid' }}><img src={'https://jf-staeulalia.pt/img/other/30/collection-green-check-mark-6.jpg'} style={{ position: 'relative', left: '40%', height: '30px', width: '30px' }} onClick={function () { setAdmin(user.username); }} /></td>
                            
                        </tr>
                    );
                }
            });
        }
        else {
            return (
                <p>Ne postoji takav korisnik!</p>
            );
        }

    };



    return (
        <div>
            <Header />
            <div>
                <Stack direction='column' justifyContent='center' alignItems='top' spacing='1rem'>
                    <h1 style={{ alignSelf: 'center', marginBlockStart: '50px' }}> Upravljaj kategorijama</h1>
                    <Stack direction='column' justifyContent='center' alignItems='top' spacing='1rem' style={{ marginInline: '200px', alignSelf: 'center' }}>
                        <form onSubmit={function () { addCategory(name); }}>
                            <p>Pretraži kvizove</p>
                            <Stack direction='row' justifyContent='left' alignItems='center' spacing='5rem' >
                                <input style={{ height: '30px', width: '200px' }} onChange={handleName} className="input"
                                    type="text" name='name' id="name" value={name} placeholder="Upišite ime:" />
                                <MyButton type="submit">Dodaj</MyButton>
                            </Stack>
                        </form>

                    </Stack>
                    <Stack direction='row' justifyContent='center' alignItems='top' spacing='1rem'>
                        <div>
                            <p>Sve kategorije: </p>
                            <table id="users">
                                <thead>
                                    <tr style={{
                                        height: '40px',
                                        padding: '12px 0px 12px 0px',
                                        textAlign: 'center',
                                        backgroundColor: 'rgba(255, 165, 0, 0.5)',


                                    }}>
                                        <th style={{ borderLeft: '1px solid #eeeee4', borderBlock: '1px solid', margin: '0px' }}>Naziv kategorije</th>
                                        <th style={{ borderLeft: '1px solid #eeeee4', borderRight: '1px solid #eeeee4', borderBlock: '1px solid', margin: '0px' }}>Izbriši kategoriju</th>
                                    </tr>
                                </thead>
                                <tbody>{renderFirstTable()}</tbody>
                            </table>
                            <MyButton onClick={function () { handleNumberOfCategories(); }}>Show more!</MyButton>
                        </div>
                    </Stack>
                </Stack>
            </div>
        </div>
    );
};

export default ManageQuizes;
